export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "Kevin",
      },
      content: "First Post #HashTag, #Express",
      Images: [{}],
      Comments: [
        {
          User: {
            nickname: "nero",
          },
          content: "Great post!",
        },
        {
          User: {
            nickname: "jaehan",
          },
          content: `it's really educational`,
        },
      ],
      imagePaths: [],
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
